      version = "4.0.1"
    }
  }
}
provider "azurerm" {
  features {}
}
resource "azurerm_resource_group" "res-0" {
  location   = "westus"
  managed_by = ""
  name       = "rg-tangerryterraform"
  tags = {
    Creator          = "tangerry@microsoft.com"
    DateCreated      = "2024-10-24T00:16:36Z"
    DeleteAfter      = "2024-11-02T23:59:54.5718333+00:00"
